import axios from "axios"
import "./Admin.css";

function Admin() {
    const [user,setuser] = useState([])
    
    useEffect(()=>{
        const fecthAllUser = async () =>{
            try{
                const res = await axios.get("http://localhost:8800/user")
                setuser(res.data);
            }catch(err){
                console.log(err)
            }
        }
        fecthAllUser()
    },[])
    
    return (
    <div className='mainvin'>
       <div className='text'>Админ</div>
       <div className="text">{user.map(use=>(
        <div className="alluse mainvin" key={user.id}>
            <a>{user.email}</a>
        </div>
       ))}</div>
    </div>
    )
}

export default Admin
